// src/components/LoginHeader.js
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { useCart, useOrder } from '../CartContext'; // Import useCart and useOrder hooks

function LoginHeader() {
  const { cart } = useCart(); // Get cart from context
  const { orders, cancelOrder } = useOrder(); // Get orders and cancelOrder function from context
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const cartItemCount = cart.length; // Number of items in the cart

  const handleDropdownToggle = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  const handleCancelOrder = (orderId) => {
    const order = orders.find(o => o.id === orderId);
    const deliveryDate = new Date(order.deliveryDate);
    const today = new Date();
    const timeDiff = deliveryDate.getTime() - today.getTime();
    const daysDiff = Math.ceil(timeDiff / (1000 * 3600 * 24));

    if (daysDiff > 5) {
      cancelOrder(orderId);
      alert('Order cancelled successfully.');
    } else {
      alert('Cannot cancel the order. Cancellation is allowed up to 5 days before the delivery date.');
    }
  };

  return (
    <header className="header">
      <div className="width">
        <Link to="/" className="logo">
          <h1>Smart Homes</h1>
        </Link>
      </div>
      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/products/doorbells">Smart Doorbell</Link></li>
          <li><Link to="/products/doorlocks">Smart Doorlock</Link></li>
          <li><Link to="/products/lighting">Smart Lighting</Link></li>
          <li><Link to="/products/speakers">Smart Speaker</Link></li>
          <li><Link to="/products/thermostats">Smart Thermostat</Link></li>
          <li>
            <Link to="/cart" className="cart-icon">
              <span className="cart-icon-text">Cart</span>
              {cartItemCount > 0 && (
                <span className="cart-badge">{cartItemCount}</span>
              )}
            </Link>
          </li>
          <li className="account-icon">
            <button onClick={handleDropdownToggle}>Account</button>
            {isDropdownOpen && (
              <div className="dropdown-menu">
                <Link to="/account">Account Information</Link>
                <div className="past-orders">
                  <h3>Past Orders</h3>
                  <ul>
                    {orders.map(order => (
                      <li key={order.id}>
                        <p>Confirmation Number: {order.confirmationNumber}</p>
                        <p>Delivery Date: {new Date(order.deliveryDate).toLocaleDateString()}</p>
                        {order.confirmationNumber && (
                          <button onClick={() => handleCancelOrder(order.id)}>Cancel Order</button>
                        )}
                      </li>
                    ))}
                  </ul>
                </div>
              </div>
            )}
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default LoginHeader;
